//en.m.wikipedia.org/wiki/Talk:Griselda_Blanco\"}},\"extract\":\"Griselda Blanco Restrepo, known as the Black Widow or Cocaine Godmother, was a Colombian drug lord who was prominent in the cocaine-based drug trade and underworld of Miami, US, during the 1970s through the early 2000s, and who has also been claimed by some to have been part of the Medellín Cartel. Blanco was assassinated in Medellín on September 3, 2012, aged 69.\",\"extract_html\":\"<p><b>Griselda Blanco Restrepo</b>, known as <b>the Black Widow</b> or <b>Cocaine Godmother</b>, was a Colombian drug lord who was prominent in the cocaine-based drug trade and underworld of Miami, US, during the 1970s through the early 2000s, and who has also been claimed by some to have been part of the Medellín Cartel. Blanco was assassinated in Medellín on September 3, 2012, aged 69.</p>\",\"normalizedtitle\":\"Griselda Blanco\"},{\"views\":195768,\"rank\":8,\"view_history\":[{\"date\":\"2024-01-27Z\",\"views\":73498},{\"date\":\"2024-01-28Z\",\"views\":157154},{\"date\":\"2024-01-29Z\",\"views\":194706},{\"date\":\"2024-01-30Z\",\"views\":228228},{\"date\":\"2024-01-31Z\",\"views\":195768}],\"type\":\"standard\",\"title\":\"2023_AFC_Asian_Cup\",\"displaytitle\":\"<span class=\\\"mw-page-title-main\\\">2023 AFC Asian Cup</span>\",\"namespace\":{\"id\":0,\"text\":\"\"},\"wikibase_item\":\"Q20779252\",\"titles\":{\"canonical\":\"2023_AFC_Asian_Cup\",\"normalized\":\"2023 AFC Asian Cup\",\"display\":\"<span class=\\\"mw-page-title-main\\\">2023 AFC Asian Cup</span>\"},\"pageid\":48085960,\"thumbnail\":{\"source\":\"https://upload.wikimedia.org/wikipedia/en/thumb/f/f2/2023_AFC_Asian_Cup_logo.svg/320px-2023_AFC_Asian_Cup_logo.svg.png\",\"width\":320,\"height\":378},\"originalimage\":{\"source\":\"https://upload.wikimedia.org/wikipedia/en/thumb/f/f2/2023_AFC_Asian_Cup_logo.svg/291px-2023_AFC_Asian_Cup_logo.svg.png\",\"width\":291,\"height\":344},\"lang\":\"en\",\"dir\":\"ltr\",\"revision\":\"1201868122\",\"tid\":\"cb99c080-